import { useRouter } from 'next/router'
import {useEffect } from "react"
import {Home, Settings, Sale } from '../../components/Dashboard'



 const SideBarPages = ()=> {

       const route = [
           {
               slug: 'home',
               label: "Admin HomePage",
               component: <Home/>
           },
           {
            slug: 'sale',
            label: "Hehhehe",
            component: <Sale/>
        }
       ]

       const router  = useRouter()
       let currentPath = router.query.pages

       const FindSlugMatchingComp = ()=> route.find((cmp => {
           return cmp.slug === currentPath
       }))

       useEffect(() => {
         const foundComponent = FindSlugMatchingComp()

         if(currentPath && !foundComponent){
             console.log('ejejejje')
            router.push("/404")
        } 

       }, [router])

       const component = FindSlugMatchingComp().component


    return (
        <div>
            {component}
        </div>
    )
}

export default SideBarPages
